import React, { useEffect, useState } from "react";

import { useAuth } from "../provider/authProvider";
import { useNavigate } from "react-router-dom";
import Rosary from "../models/rosary";

const Home = () => {
  //   const navigate = useNavigate();
  const { token } = useAuth();
  const [ros, setRos] = useState({});
  useEffect(() => {
    const getRosary = async () => {
      const today2 = await Rosary.getByDate("2023/05/30");
      setRos((r) => ({ ...r, ...today2.data[0] }));

      // console.log(today2.data[0]);

      // for (let data of ros.data) {
      //   console.log(data.i_believe);
      // }
    };
    getRosary();
  }, []);
  console.log(ros["hail _mary_1"]);

  // const parseData = () => {
  //   Object.values(ros).map((r) => {
  //     <>
  //       <p>{r}</p>
  //     </>;
  //   });
  // for (let data of Object.values(ros)) {
  //   return (
  //     <>
  //       <p>{data}</p>
  //       <br />
  //     </>
  //   );
  // }

  const parseAnnounces = () => {
    let annouceQueue = [];
    for (let i = 1; i <= 5; i++) {
      const announce = (
        <div>
          <span>
            <h3>Announce {i}</h3>
            <p>{ros[`announce_${i}`]}</p>
          </span>
          <span>
            <h3>Our Father</h3>
            <p>{ros["our _father_1"]}</p>
          </span>
          <span>
            <h3>Hail Mary X10</h3>
            <small>*While meditating on the rosary mystery*</small>
            <p>{ros["hail _mary_1"]}</p>
          </span>
          <span>
            <h3>Glory Be to the Father</h3>
            <small>*Holding Chain*</small>
            <p>{ros.glory_be_1}</p>
          </span>
          <span>
            <h3>Fatima Prayer (oh my Jesus)</h3>
            <p>{ros.oh_my_jesus_1}</p>
          </span>
        </div>
      );
      annouceQueue.push(announce);
    }
    return annouceQueue;
  };

  return (
    <div>
      <h1>Home page</h1>
      {/* <div>
        {Object.values(ros).map((r) => (
          <p>{r}</p>
        ))}
      </div> */}
      <span>
        <h3>Apostles Creeed</h3>
        <small>*Holding Crucifix*</small>
        <p>{ros.i_believe}</p>
      </span>
      <span>
        <h3>Our Father</h3>
        <p>{ros["our _father_1"]}</p>
      </span>
      <span>
        <h3>Hail Mary X3</h3>
        <p>{ros["hail _mary_1"]}</p>
      </span>
      <span>
        <h3>Glory Be to the Father</h3>
        <small>*Holding Chain*</small>
        <p>{ros.glory_be_1}</p>
      </span>
      {parseAnnounces()}
      <span>
        <h3>Hail, Holy Queen</h3>
        <p>{ros.holy_queen}</p>
      </span>
      <span>
        <h3>Final Prayer</h3>
        <p>{ros.final_prayer}</p>
      </span>
      <span>
        <h3>{ros.in_the_name_1}</h3>
      </span>
    </div>
  );
};

export default Home;
